import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import {Link} from 'react-router-dom';


const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

function createBook(title, author, year, genre, rating) {
  return { title, author, year, genre, rating};
}

const rows = [
  createBook('The Name Of the Wind', 'Patrick Rothfuss', 2007, 'Fantasy', 4),
  createBook('Nevernight', 'Jay Kristoff', 2016, 'Fantasy', 3),
  createBook('All The Light We Cannot See', 'Anthony Doerr', 2014, 'Historical Fiction', 4),
  createBook('The Troop', 'Nick Cutter', 2014, 'Horror', 3),
  createBook('Jump', 'Daniella Moyles', 2020, 'Biography', 3),

];

export default function MyBooks() {
  const classes = useStyles();


  return (
    <Container maxWidth="sm">
    <TableContainer component={Paper}>
      <Table className={classes.table} size="small" aria-label="a dense table">
        <TableHead>
          <TableRow>
            <TableCell>Title (100g serving)</TableCell>
            <TableCell align="right">Author</TableCell>
            <TableCell align="right">Year</TableCell>
            <TableCell align="right">Genre</TableCell>
            <TableCell align="right">Rating</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.author}</TableCell>
              <TableCell align="right">{row.year}</TableCell>
              <TableCell align="right">{row.genre}</TableCell>
              <TableCell align="right">{row.rating}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </Container>
    
  );
        
}
